import Button from "@mui/material/Button";
import RestartAltIcon from "@mui/icons-material/RestartAlt";
import SendIcon from "@mui/icons-material/Send";

const Buttons = () => {
  return (
    <div>
      <Button>
        <RestartAltIcon />
        Reset
      </Button>
      <Button>
        <SendIcon />
        Send to Slack
      </Button>
    </div>
  );
};

export default Buttons;
